$db_structure = "

--
-- Structure de la table `prefixe_variable_billets`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_billets` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_auteur` int(11) DEFAULT NULL COMMENT 'id de la table auteur',
  `edit` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `date_edit` datetime DEFAULT NULL,
  `titre` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `contenu` longtext CHARACTER SET utf8 COLLATE utf8_roman_ci,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Ensemble des billets enregistrés' AUTO_INCREMENT=113 ;

-- --------------------------------------------------------

--
-- Structure de la table `prefixe_variable_comments`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_comments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_billet` int(11) NOT NULL COMMENT 'id de billets',
  `id_auteur` int(11) NOT NULL COMMENT 'id de users',
  `date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `contenu` mediumtext CHARACTER SET utf8 COLLATE utf8_roman_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Ensemble des commentaires postés' AUTO_INCREMENT=6 ;

-- --------------------------------------------------------

--
-- Structure de la table `prefixe_variable_config`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_config` (
  `parametre` char(20) COLLATE utf8_bin NOT NULL,
  `valeur` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`parametre`),
  UNIQUE KEY `parametre` (`parametre`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Parametres generaux';

-- --------------------------------------------------------

--
-- Structure de la table `prefixe_variable_languages`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_languages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom` char(3) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Répertorie les langues installées' AUTO_INCREMENT=2 ;

-- --------------------------------------------------------

--
-- Structure de la table `prefixe_variable_styles`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_styles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom` varchar(15) COLLATE utf8_bin NOT NULL,
  `fichier_css` char(15) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Répertorie les styles installés' AUTO_INCREMENT=3 ;

-- --------------------------------------------------------

--
-- Structure de la table `prefixe_variable_users`
--

CREATE TABLE IF NOT EXISTS `prefixe_variable_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pseudo` varchar(25) COLLATE utf8_bin NOT NULL,
  `prenom` varchar(25) COLLATE utf8_bin DEFAULT NULL,
  `nom` varchar(25) COLLATE utf8_bin DEFAULT NULL,
  `genre` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `email` varchar(40) COLLATE utf8_bin DEFAULT NULL,
  `password` varchar(255) COLLATE utf8_bin NOT NULL,
  `level` tinyint(1) NOT NULL DEFAULT '1',
  `date_inscription` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `id_style` tinyint(2) NOT NULL DEFAULT '1' COMMENT 'Feuille css choisie',
  `id_language` tinyint(2) NOT NULL DEFAULT '1' COMMENT 'Id de la table languages',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Répertorie les utilisateurs' AUTO_INCREMENT=6 ;
		
			" ;


